import React, { LinkHTMLAttributes, CSSProperties } from 'react';
import * as S from './styles';

type LinkProps = LinkHTMLAttributes<HTMLLinkElement> & {
    onClick?: () => void;
    children?: React.ReactNode;
    suffix?: React.ReactNode;
    preffix?: React.ReactNode;
    href?: React.ReactNode;
    target?: React.HTMLAttributeAnchorTarget | undefined;
    style?: CSSProperties;
    color?: string;
}

const Link: React.FC<LinkProps> = ({
  onClick, children, suffix, href, target, preffix, color, style,
}: LinkProps) => (
  <S.Link
    target={target}
    href={href}
    onClick={onClick}
    suffixIcon={!!suffix}
    prefixIcon={!!preffix}
    style={style}
    color={color}
  >
    {preffix}
    {children}
    {suffix}
  </S.Link>
);

export default Link;
